import React from "react";
import cl from "./Home.module.css";

const Home = () => {
  return (
    <div class={cl.HomeMainContainer}>
      <section className={cl.EcommerceContainer}>test </section>
      <section className={cl.FormContainer}>test</section>
    </div>
  );
};

export default Home;
